// SPDX-License-Identifier: MIT
pragma solidity 0.8.7;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract NftBaseV2 is ERC1155, Pausable, Ownable {

    using SafeMath for uint;

    mapping(uint => address) holders;
    
    string artistName;
    string baseURI;
    string public baseExtension = ".json";
    uint256 public cost = 0 ether;
    uint256 public maxSupply;
    uint256 public maxMintAmount;
    bool public revealed = false;
    address picardyAddress;
    address creator;

    constructor(
        uint _maxSupply,
        uint _maxMintAmount,
        uint _cost,
        uint _id,
        string memory _name,
        string memory _symbol,
        string memory _initBaseURI,
        string memory _artistName,
        address _picardyAddress,
        address _creator) ERC1155(_initBaseURI){ 
        maxSupply = _maxSupply;
        maxMintAmount = _maxMintAmount;
        picardyAddress = _picardyAddress;
        creator = _creator;
        artistName = _artistName;
        _mint(_creator, _id, _maxSupply, "");
    }

    function setCost(uint256 _newCost) public onlyOwner {
        cost = _newCost;

    }

    function setmaxMintAmount(uint256 _newmaxMintAmount) public onlyOwner {
        maxMintAmount = _newmaxMintAmount;
    }

    function setBaseURI(string memory _newBaseURI) public onlyOwner {
        baseURI = _newBaseURI;
    }

    function setBaseExtension(string memory _newBaseExtension) public onlyOwner {
        baseExtension = _newBaseExtension;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function mint(address _creator, uint256 _id, uint256 _amount) external onlyOwner {
        _mint(_creator, _id, _amount, "");
    }

    function getBalanceOf(address _holder, uint256 _id) external view {
        balanceOf(_holder, _id);
    }

}
